import './rightbar.css'

function Rightbar() {
    return (
        <div className="rightbar">
            <div className="rightbar">
                <div className="birthdayContainer">
                    <img src="" alt="bday pic" className="birthdayImg" />
                </div>
            </div>
        </div>
        
    )
}

export default Rightbar
